/*
 *
 * BIC Calendar
 * Llicència Apache
 * Translation by Reza Esmaili
 *
 * NOTE: there wedding dates plugin needed changes in line 246, 307, 420
 *
 */

// TODO add start_date
// TODO mark current day

$.fn.bic_calendar = function(options) {
    
    var opts = $.extend({}, $.fn.bic_calendar.defaults, options);

    this.each(function(){
        
        var calendar;
		var headlineDayMonth;
		var headlineCurrentMonth = $('<div class="headline-current-month"></div>');
		
		var id_calendar = "bic_cal_" + Math.floor(Math.random()*99999).toString(36);

        var events = opts.events;
		
		var days;
        
        if ( typeof opts.days != "undefined" )
            days = opts.days;
        else
            days = ["Mo", "Tu", "We", "Th", "Fr", "Sa", "Su"];
			
		var monthNames;

        if ( typeof opts.monthNames != "undefined" )
            monthNames = opts.monthNames;
        else
            monthNames = ["January", "February", "March", "April", "May", "June", "July", "August", "September", "October", "November", "December"];
        
        var show_days;
        if ( typeof opts.show_days != "undefined" )
            show_days = opts.show_days;
        else
            show_days = true;

        if ( typeof opts.events != "undefined" )
            events = opts.events;
        else
            events = [];

        if ( typeof opts.targetURL != "undefined" )
            targetURL = opts.targetURL;
        else
            targetURL = false;

        if ( typeof opts.startDate != "undefined" )
            startDate = opts.startDate;
        else
            startDate = false;

        if ( typeof opts.anchor != "undefined")
            anchor = '#' + opts.anchor;
        else
            anchor = '';

        if ( typeof opts.noHighlightToday != "undefined")
            noHighlightToday = opts.noHighlightToday;
        else
            noHighlightToday = false;

        var popover_options;
        if ( typeof opts.popover_options != "undefined" )
            popover_options = opts.popover_options;
        else
            popover_options = {placement: 'top'};

        var tooltip_options;
        if ( typeof opts.tooltip_options != "undefined" )
            tooltip_options = opts.tooltip_options;
        else
            tooltip_options = {placement: 'top'};

        var req_ajax;
        if ( typeof opts.req_ajax != "undefined" )
            req_ajax = opts.req_ajax;
        else
            req_ajax = false;

        // create date for today
        var tempDate = new Date();


        var m = ('0'+String(tempDate.getMonth()+1)).slice(-2);
        var d = ('0'+String(tempDate.getDate())).slice(-2);

        today = tempDate.getFullYear() + '-' + m + '-' + d;

        // caller element
        var elem = $(this);

		// get date class
		if (startDate) {
			var objDate = new Date(startDate);
		} else {
			var objDate = new Date();
		}

		var month = objDate.getMonth();
		var year = objDate.getFullYear();

		/* self defined next event */
		$(this).on('bic_calendar_next', function(e) {
			month = (month + 1) % 12;
			if (month==0)
				year++;
			changeMonth(month, year);
		});

		/* self defined prev event */
		$(this).on('bic_calendar_prev', function(e) {
			month -= 1;
			if (month==-1){
				year--;
				month = 11;
			}
			changeMonth(month, year);
		});

        // show calendar
		showCalendar();
        
        // function to show the calendar
        function showCalendar(){

            // headline
            headlineDayMonth = $('<table class="diasmes table table">');
			
			listDays();

            // check if there's a date in the INPUT field
			var writtenDate = elem.val();

            if (writtenDate != ""){
                if (validateWrittenDate(writtenDate)){
                    var arrayWrittenDate = writtenDate.split("/");
                    // check if the year has just 2 chars
                    if(arrayWrittenDate[2].length == 2){
                        if (arrayWrittenDate[2].charAt(0)=="0"){
                            arrayWrittenDate[2] = arrayWrittenDate[2].substring(1);
                        }
                        arrayWrittenDate[2] = parseInt(arrayWrittenDate[2]);
                        if (arrayWrittenDate[2] < 50)
                            arrayWrittenDate[2] += 2000;
                    }
                    objDate = new Date(arrayWrittenDate[2], arrayWrittenDate[1]-1, arrayWrittenDate[0])
                }
            }
				
            // show days of the month
            showDayMonth(month, year);

            // add previous / next buttons
            var buttonNextMonth = $('<td><a href="#" class="button-next-month"><i class="icon-arrow-right" ></i></a></td>');
            buttonNextMonth.click(function(e){
				$('.bic_calendar').trigger("bic_calendar_next");
                e.preventDefault();
            })
            var buttonPreviousMonth = $('<td><a href="#" class="button-previous-month"><i class="icon-arrow-left" ></i></a></td>');
            buttonPreviousMonth.click(function(e){
				$('.bic_calendar').trigger("bic_calendar_prev");
                e.preventDefault();
            })
			
            // get headline
            var headlineMonthYear = $('<table class="table header"><tr></tr></table>');
            var headlineMonthYearControl = $('<td colspan=5 class="month-year span6"></td>');
            headlineMonthYear.append(buttonPreviousMonth);
            headlineMonthYear.append(headlineMonthYearControl);
            headlineMonthYear.append(buttonNextMonth);
            headlineMonthYearControl.append(headlineCurrentMonth);
				
            // calendar wrapper
            calendar = $('<div class="bic_calendar" id="' +id_calendar +'" ></div>');
            calendar.prepend(headlineMonthYear);
            calendar.append(headlineDayMonth);
				
            // add calendar to DOM
            elem.append(calendar);
            
            check_events(month, year);
        }
		
        function changeMonth(month, year){
            headlineDayMonth.empty();
            listDays();
            showDayMonth(month, year);
            check_events(month, year);
        }       

        // function to list the days
        function listDays(){
            if ( show_days != false ){
                var headlineDayWeek = $('<tr class="day-week" >');
                var insertCode = '';
                $(days).each(function(indice, valor){
                    insertCode += '<td';
                    if (indice==0){
                        insertCode += ' class="first"';
                    }
                    if (indice==6){
                        insertCode += ' class="sunday last"';
                    }
                    insertCode += ">" + valor + '</td>';
                });
                insertCode += '</tr>';
                headlineDayWeek.append(insertCode);

                headlineDayMonth.append(headlineDayWeek);
            }
        }
                
        function showDayMonth(month, year){
            // show the headline
            headlineCurrentMonth.text(monthNames[month] + " " + year);
			
            // show days of the month
            var dayCounter = 1;
			
            // get first day of the month
            var firstDay = calculateNumberDayWeek(1, month, year);
            // get last day of the month
            var lastDayMonth = lastday(month,year);
            
            var n_month = month + 1;
            
            var headlineDayMonth_string = "";
			
            // start with the first day of the week
            for (var i=0; i<7; i++){
                if (i < firstDay){
                    var codeDay = "";
                    if (i == 0)
                        codeDay += "<tr>";
                    // if the day of the week i is less than the number of the first day of the week do not put anything in the cell
                    codeDay += '<td class="invalid-day';
                    if (i == 0)
                        codeDay += " first";
                    codeDay += '"></td>';
                } else {
                    var codeDay = "";
                    if (i == 0)
                        codeDay += '<tr>';
						
					display_month = ('0'+String(n_month)).slice(-2);
					display_day = ('0'+String(dayCounter)).slice(-2);

                    var dateString = year + "-" +  display_month  + "-" + display_day;
                    if (dateString == today && !noHighlightToday) {
                        addClass = ' today';
                    } else {
                        addClass = '';
                    }

                    codeDay += '<td class="day' + addClass + '" id="' + id_calendar + '_' + year + "_" +  display_month  + "_" + display_day + '" ';

                    if (i == 0)
                        codeDay += ' class="first"';
                    if (i == 6)
                        codeDay += ' class="last sunday"';

                    if (targetURL) {
                        if (targetURL.indexOf('?') != -1) {
                            codeDay += '><a href="' + targetURL + '&date=' + dateString + '" data-date="' + dateString + '">' + dayCounter + '</a></span>';
                        } else {
                            codeDay += '><a href="' + targetURL + '?date=' + dateString + '" data-date="' + dateString + '">' + dayCounter + '</a></span>';
                        }
                    } else {
                        codeDay += '><a data-date="' + dateString + '">' + dayCounter + '</a></span>';
                    }

                    if (i == 6)
                        codeDay += '</tr>';
                    dayCounter++;
                }
                headlineDayMonth_string += codeDay
            }
			
            // loop through every day until the end of the month
            var currentDayWeek = 1;
            while (dayCounter <= lastDayMonth){
                var codeDay = "";
                if (currentDayWeek % 7 == 1)
                    codeDay += "<tr>";

				display_month = ('0'+String(n_month)).slice(-2);
				display_day = ('0'+String(dayCounter)).slice(-2);

                var dateString = year + "-" +  display_month  + "-" + display_day;
                if (dateString == today && !noHighlightToday) {
                    addClass = ' today';
                } else {
                    addClass = '';
                }

                codeDay += '<td class="day' + addClass + '" id="' + id_calendar + '_' + year + "_" +  display_month  + "_" + display_day + '" ';

                // if we are at the beginning of the week
                if (currentDayWeek % 7 == 1)
                    codeDay += ' class="first"';
                // if we are at the end of the week and sunday is the last day
                if (currentDayWeek % 7 == 0)
                    codeDay += ' class="sunday last"';

                if (targetURL) {
                    if (targetURL.indexOf('?') != -1) {
                        codeDay += '><a href="' + targetURL + '&date=' + dateString + anchor + '" data-date="' + dateString + '">' + dayCounter + '</a></span>';
                    } else {
                        codeDay += '><a href="' + targetURL + '?date=' + dateString + anchor + '" data-date="' + dateString + '">' + dayCounter + '</a></span>';
                    }
                } else {
                    codeDay += '><a data-date="' + dateString + '">' + dayCounter + '</a></span>';
                }

                if (currentDayWeek % 7 == 0)
                    codeDay += "</tr>";
                dayCounter++;
                currentDayWeek++;
                headlineDayMonth_string += codeDay
            }
			
            // compruebo que celdas me faltan por escribir vacias de la última semana del month
            currentDayWeek--;
            if (currentDayWeek%7!=0){
                codeDay = "";
                for (var i=(currentDayWeek%7)+1; i<=7; i++){
                    var codeDay = "";
                    codeDay += '<td class="invalid-day';
                    if (i==7)
                        codeDay += ' last'
                    codeDay += '"></td>';
                    if (i==7)
                        codeDay += '</tr>'
                    headlineDayMonth_string += codeDay
                }
            }
            
            headlineDayMonth.append( headlineDayMonth_string );
        }
        // function to calculate the correct day of the week
        function calculateNumberDayWeek(dia,month,year){
            var objDate = new Date(year, month, dia);
            var numDay = objDate.getDay();
            if (numDay == 0) 
                numDay = 6;
            else
                numDay--;
            return numDay;
        }
		
        // function to check if the date is correct
        function checkdate ( y, m, d ) {
            // function from http://kevin.vanzonneveld.net
            // taken from the phpjs.org manual at http://www.desarrolloweb.com/manuales/manual-librerias-phpjs.html
            return m > 0 && m < 13 && y > 0 && y < 32768 && d > 0 && d <= (new Date(y, m, 0)).getDate();
        }
		
        // function to get the last day of a month and year
        function lastday(month,year){ 

            var d = new Date(year, month + 1, 0);
            var last_day = d.getDate();

            /*
            var last_day=28;
            while (checkdate(month+1, last_day + 1, year)) {
                console.log("++ am arsch!");
                last_day++; 
            }
            */
            return last_day; 
        } 
		
        function validateWrittenDate(date){
            var arrayDate = date.split("-");
            if (arrayDate.length!=3)
                return false;
            return checkdate(arrayDate[0], arrayDate[1], arrayDate[2]);
        }

        function check_events(month, year){
            if (req_ajax != false){
                // ajax request
                $.ajax({
                    type: req_ajax.type,
                    url: req_ajax.url,
                    data: { month: month + 1, year: year },
                    dataType: 'json'
                }).done(function( data ) {

                    events = [];

                    $.each(data, function(k,v){
                        events.push(data[k]);
                    });

                    markEvents(month, year);

                });
            } else {
                markEvents(month, year);
            }
        }
        
        function markEvents(month, year){
            var t_month = month + 1;
			t_month = ('0'+String(t_month)).slice(-2);
            
            for(var i=0; i< events.length; i++) {
                
				if ( events[i][0].split('-')[1] == t_month && events[i][0].split('-')[0] == year ){

                    $('#' + id_calendar + '_' + events[i][0].replace(/\-/g, "_") ).addClass('event');
                    
                    $('#' + id_calendar + '_' + events[i][0].replace(/\-/g, "_") + ' a' ).attr('data-original-title', events[i][1]);

                    // bg
                    if ( events[i][3] )
                        $('#' + id_calendar + '_' + events[i][0].replace(/\-/g, "_") ).addClass(events[i][3]);
                        //$('#' + id_calendar + '_' + events[i][0].replace(/\-/g, "_") ).css('background', events[i][3]);

                    // link
                    if ( events[i][2] == '' || events[i][2] == '#' ){
                        if ( events[i][4] != '' ){
                            $('#' + id_calendar + '_' + events[i][0].replace(/\-/g, "_") + ' a' ).attr('data-trigger', 'manual');
                            $('#' + id_calendar + '_' + events[i][0].replace(/\-/g, "_") + ' a' ).addClass('manual_popover');
                        } else {
                            $('#' + id_calendar + '_' + events[i][0].replace(/\-/g, "_") + ' a' ).attr('href', 'javascript:false;');
                        }
                    } else {
                        $('#' + id_calendar + '_' + events[i][0].replace(/\-/g, "_") + ' a' ).attr('href', events[i][2]);
                    }


                    // tooltip vs popover
                    if ( events[i][4] ){
                        $('#' + id_calendar + '_' + events[i][0].replace(/\-/g, "_") ).addClass('event_popover');
                        $('#' + id_calendar + '_' + events[i][0].replace(/\-/g, "_") + ' a' ).attr('rel', 'popover');
                        $('#' + id_calendar + '_' + events[i][0].replace(/\-/g, "_") + ' a' ).attr('data-content', events[i][4]);
                    } else {
                        $('#' + id_calendar + '_' + events[i][0].replace(/\-/g, "_") ).addClass('event_tooltip');
                        $('#' + id_calendar + '_' + events[i][0].replace(/\-/g, "_") + ' a' ).attr('rel', 'tooltip');
                    }
                }
            }
            
            $('#' + id_calendar + ' ' + '.event_tooltip a').tooltip(tooltip_options);
            $('#' + id_calendar + ' ' + '.event_popover a').popover(popover_options);

            $('.manual_popover').click( function(e){
                $(this).popover('toggle');
            } );
        }
        
    });

    return this;
};

